import React from "react";

const Widgets = () => {
  return (
    <>
        <div class="col-sm-6 col-xl-3 mb-30">
          <div class="widget-content-style bg-success full-height">
            <div class="row align-items-center p-20">
              <div class="col-4">
                <i class="ti-stats-up"></i>
              </div>
              <div class="col-8 text-right">
                <span class="text-white">Today Income</span>
                <h2 class="mb-0 widget-content-text text-white">$5,232</h2>
              </div>
            </div>
          </div>
        </div>

       
    </>
  );
};

export default Widgets;
